package a2_method;

public class a2multiply {

	public static void b2(int a, int b) {
		
		int c=a*b;
		int d=a/b;
		
		
		
		System.out.println(c);
		
		System.out.println(d);
		
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		a2multiply.b2(6,2);
		a2multiply.b2(5,4);
		a2multiply.b2(6,3);
		a2multiply.b2(2,3);
		a2multiply.b2(100, 50);

	}

}
